import React from 'react';
import Map from './Map';


class App extends React.Component {
    render () {
        return (
            <div className="row">
                <div className="col-6">
                    <Map />
                </div>
                <div className="col-5 w-100"></div>

                <button className="w-100 btn btn-danger">asd</button>
            </div>
        );
    }
};
export default App;
